export class User implements IUser {
  id?: number;
  email?: string;
  firstName?: string;
  lastName?: string;
  name?: string;
  role?: number;
  status?: number;
  createDate?: Date;
  identityUserId?: string;

  constructor(data?: IUser) {
    if (data) {
      for (var property in data) {
        if (data.hasOwnProperty(property)) (this as any)[property] = (data as any)[property];
      }
    }
  }

  init(_data?: any) {
    if (_data) {
      this.id = _data['id'];
      this.email = _data['email'];
      this.firstName = _data['firstName'];
      this.lastName = _data['lastName'];
      this.name = _data['name'];
      this.role = _data['role'];
      this.status = _data['status'];
      this.createDate = _data['createDate']
        ? new Date(_data['createDate'].toString())
        : (undefined as any);
      this.identityUserId = _data['identityUserId'];
    }
  }

  static fromJS(data: any): User {
    data = typeof data === 'object' ? data : {};
    let result = new User();
    result.init(data);
    return result;
  }

  toJSON(data?: any) {
    data = typeof data === 'object' ? data : {};
    data['id'] = this.id;
    data['email'] = this.email;
    data['firstName'] = this.firstName;
    data['lastName'] = this.lastName;
    data['name'] = this.name;
    data['role'] = this.role;
    data['status'] = this.status;
    data['createDate'] = this.createDate ? formatDate(this.createDate) : (undefined as any);
    data['identityUserId'] = this.identityUserId;
    return data;
  }
}

export interface IUser {
  id?: number;
  email?: string;
  firstName?: string;
  lastName?: string;
  name?: string;
  role?: number;
  status?: number;
  createDate?: Date;
  identityUserId?: string;
}

